import {toast, ToastContainer} from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import Home from './components/Home';
import Menu from './components/Menu';

function App() {
  return (
    <div className="App">
      <Menu/>
      <div class="mt-20">
        <ToastContainer/>
          <BrowserRouter>
          </BrowserRouter>
          {/* <Login/> */}
          <Home/>
      </div>


    </div>
  );
}

export default App;
